import React from 'react';
import { Alert } from 'reactstrap';

export const QueryMessages = (props) => {
  return (
    <div className="container d-flex flex-row justify-content-center bd-highlight mb-3">
      <Alert color="info">
        <h3>Database Query Time: {props.queryTime}</h3>
      </Alert>
      <Alert color="light">
        <h1>Total record found: {props.count}</h1>
      </Alert>
      <Alert color="dark">
        <h3>Page Load Time: {props.pageLoadTime}</h3>
      </Alert>
    </div>
  );
};
